    let [numPage, setNumPage] = useState(1)
    return(
        <div className="page-container">
            <button className="page_num-btn">Previous</button>
            <label className="page-num page-num_start">{numPage}</label>
            <label className="page-num"> of 51</label>
            <button className="page_num-btn">Next</button>
            <FontAwesomeIcon icon={faArrowRight} />
        </div>
    )
}
